"""# Criando uma rede neural transfer learning com MobileNetV2 üìö

**Problema identificado nas redes neurais CNN constru√≠das do zero:**

Perceba aqui que a nossa rede rede neural CNN para classificar c√£es e gatos n√£o foi t√£o eficaz assim. Dentro de um dos problemas de deep learning, temos a quest√£o de overfitting que pode ser ocasionada por v√°rios cen√°rios.

Perceba que ao analisar o gr√°fico da nossa rede neural convolucional, at√© a 10¬™ √©poca de processamento, os conjuntos de treinamento e valida√ß√£o pareciam andar juntos em quest√£o de performance, mas esse comportamento foi se perdendo ao longo do processamento da rede, nos resultado em 71% de acur√°cia para valida√ß√£o e 84% para treinamento.

![image.png](data:image/png;base64,)

Existem muitas formas de reduzir o overfitting em deep learning, tal como t√©cnicas de regulariza√ß√£o, batch normalization e tamb√©m aumentar o tamanho da base de treinamento dos dados. Parece muito, mas 1000 imagens podem ser muito pouco para ensinar uma rede neural a aprender os detalhes e particularidades de caracter√≠sticas de imagens. Se utilizarmos por exemplo uma rede neural que j√° foi treinada com milhares de imagens de amostra, com certeza seu desempenho pode melhorar muito. Dentro do treinamento de redes neurais convolucionais, no in√≠cio da extra√ß√£o de caracter√≠sticas de imagens, alguns passos podem se tornar ‚Äúpadr√£o‚Äù em qualquer tipo de imagem, tal como identifica√ß√£o de bordas por exemplo. As camadas iniciais e centrais s√£o aplicadas √† aprendizagem por transfer√™ncia, e as √∫ltimas camadas s√£o apenas recicladas. A rede faz uso dos dados rotulados da tarefa na qual foi treinado.Se tivermos uma rede neural transfer learning que j√° sabe identificar e muito bem esse tipo de comportamento, podemos ganhar performance e dar um upgrade no nosso modelo e conseguir classificar outros tipos de imagens dado o aprendizado obtido.

**Solu√ß√£o prospota:**

Para dar um upgrade em nossa rede neural, vamos criar uma rede transfer learning utilizando a biblioteca do Keras, a MobileNetV2!

MobileNetV2 √© uma arquitetura de rede neural convolucional eficiente que utiliza blocos de gargalo, convolu√ß√µes separ√°veis, camadas residuais e outras t√©cnicas para equilibrar o desempenho e a efici√™ncia de recursos.

Vamos analisar se a transfer learning classifica esse cachorrinho com sono de forma correta?

![image.png](data:image/png;base64,)

Veja que a nossa CNN feita a m√£o, entendeu que esse cachorrinho √© um gatinho. E isso de deve por conta dos olhinhos de cachorro estar fechados, lembrando assim os de um gato, n√©?

Vamos para o desafio!

Vamos codar nossa rede?

Vamos iniciar importando as bibliotecas necess√°rias do keras para criar a transfer learning e em seguida j√° come√ßar a constru√ß√£o do modelo. Vamos chamar a classe MobileNetV2 e configurar dois hiperpar√¢metros muito importantes: **weights** e **include_top**.

weights s√£o os pesos da rede que foram treinados pela MobileNetV2.
include_top exclui a camada final de classifica√ß√£o da rede, ou seja, ela utiliza todo o treinamento aprendido pela MobileNetV2 no conjunto de imagens da ImageNet, mas na hora de criar os r√≥tulos, conseguimos criar de forma personalizada de acordo com a nossa rede neural tratada no assunto desejado.
E porque essa rede "pr√©-treinada" funciona?

Bem, porque alguns passos comuns aprendidos em redes neurais como por exemplo:

Convolu√ß√µes de Bordas e Texturas
Caracter√≠sticas Complexas de Objetos
Hierarquia de Caracter√≠sticas
Representa√ß√µes de Alto N√≠vel
Redu√ß√£o da Dimensionalidade
Uma das principais caracter√≠sticas da MobileNetV2 √© sua capacidade de generaliza√ß√£o. Como foi treinada em um conjunto de dados diversificado e desafiador, ela pode reconhecer uma ampla variedade de objetos e padr√µes em imagens de entrada.
"""

# Para trabalhar com deep learning
import tensorflow as tf
from tensorflow.keras.applications import MobileNetV2
from tensorflow.keras.layers import Dense, GlobalAveragePooling2D
from tensorflow.keras.models import Model

# Carregue o modelo MobileNetV2 pr√©-treinado (sem as camadas densas no topo)
# O MobileNetV2 √© uma rede neural pr√©-treinada que foi treinada em um grande conjunto de dados chamado ImageNet, que cont√©m milh√µes de imagens de v√°rias categorias diferentes.
# weights='imagenet': carregar os pesos pr√©-treinados da vers√£o do MobileNetV2 que foi treinada no conjunto de dados ImageNet
# include_top=False: excluindo a camada de classifica√ß√£o final (top) da rede. Essa camada de classifica√ß√£o normalmente consiste em uma camada densa (fully connected)
# que produz sa√≠das para cada classe no conjunto de dados original do ImageNet. Excluindo essa camada, voc√™ est√° preparando o modelo para personalizar a camada de classifica√ß√£o para uma nova tarefa.

base_model = MobileNetV2(weights='imagenet', include_top=False)


# Adicione camadas personalizadas no topo para a classifica√ß√£o de c√£es e gatos
x = base_model.output
x = GlobalAveragePooling2D()(x) # reduzir a dimensionalidade dos dados espaciais antes da camada de sa√≠da,
x = Dense(128, activation='relu')(x) # fun√ß√£o de ativa√ß√£o ReLU
predictions = Dense(2, activation='softmax')(x) # duas sa√≠das (duas classes, cachorrinhos e gatinhos)

# Crie o modelo final
model = Model(inputs=base_model.input, outputs=predictions)

"""Pr√≥ximo passo agora √© configurar o layer.trainable.

Esse parametro √© importante para manter as camadas j√° treinadas pela MobileNet congelada. Aqui todas as camadas do modelo MobileNet pr√©-treinado s√£o congeladas, e em seguida, camadas personalizadas s√£o adicionadas para realizar a identifica√ß√£o de c√£es e gatos. Durante o treinamento, apenas as camadas personalizadas ter√£o seus pesos ajustados, enquanto as camadas pr√©-treinadas permanecer√£o inalteradas. Para esse efeito acontecer, devemos configurar esse par√¢metro como "False".
"""

# Congelar todas as camadas pr√©-treinadas

for layer in base_model.layers:
    layer.trainable = False

"""E chegou o momento de compilar o modelo!

Aqui vamos utilizar a fun√ß√£o de custo adam, otimizando assim a identifica√ß√£o do menor erro poss√≠vel do modelo (loss function).
"""

model.compile(optimizer='adam', loss='categorical_crossentropy', metrics=['accuracy'])

"""Agora como pr√≥ximo passo, vamos pegar nossas imagens de c√£es e gatos e "tunar" elas com ImageDataGenerator! Essa ferramenta √© muito poderosa para aumentar os dados e pr√©-processar as imagens. Ele permite que voc√™ crie um fluxo de dados de imagens que pode ser usado para treinar modelos de aprendizado profundo."""

from tensorflow.keras.preprocessing.image import ImageDataGenerator

# Para evitar problemas de overfitting, usei o ImageDataGenerator
train_datagen = ImageDataGenerator(
    rescale=1.0/255, # Normaliza os valores de pixel para o intervalo de 0 a 1.
    rotation_range=20, # Aplica rota√ß√µes aleat√≥rias de at√© 20 graus nas imagens.
    width_shift_range=0.2, # Realiza deslocamentos aleat√≥rios horizontal e vertical nas imagens.
    height_shift_range=0.2,
    shear_range=0.2, # corta as bordas
    zoom_range=0.2, # aplica zoom nas imagens
    horizontal_flip=True, # realiza viragens horizontais aleat√≥rias nas imagens.
    fill_mode='nearest' # preenche os pixels que podem ser criados devido a transforma√ß√µes com os valores mais pr√≥ximos.
)

# Cria a base de treinamento
train_generator = train_datagen.flow_from_directory(
    caminho_da_pasta,
    target_size=(224, 224),
    batch_size=32,
    class_mode='categorical'
)

# Treine o modelo
model.fit(
    train_generator,
    epochs=5,
)

"""Show! Nossa rede foi treinada! Agora vamos validar a performance:"""

# chamando dados de teste
test_datagen = ImageDataGenerator(rescale=1.0/255)

test_generator = test_datagen.flow_from_directory(
    "/content/drive/MyDrive/FIAP/fase3/IA/cat_dog_tests",
    target_size=(224, 224),
    batch_size=32,
    class_mode='categorical'
)

# Avalie o modelo no conjunto de teste
test_loss, test_acc = model.evaluate(test_generator)
print(f'Acur√°cia no conjunto de teste: {test_acc}')

